### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Functional Dependencies and Normalization**
- **Functional Dependencies (FDs):** Relationships between attributes in a relation. Notation: \( X \rightarrow Y \), where \( X \) determines \( Y \).
- **Normalization:** Process of organizing data to minimize redundancy. Key normal forms:
  - **1NF (First Normal Form):** All attributes contain atomic values.
  - **2NF (Second Normal Form):** Meets 1NF and all non-key attributes are fully dependent on the primary key.
  - **3NF (Third Normal Form):** Meets 2NF and no transitive dependencies.
  - **BCNF (Boyce-Codd Normal Form):** Meets 3NF and for every functional dependency \( X \rightarrow Y \), \( X \) is a superkey.
  - **4NF (Fourth Normal Form):** Meets BCNF and has no multi-valued dependencies.

#### 2. **Decomposition**
- **Lossless Decomposition:** Decomposing a relation into smaller relations without losing information.
- **Dependency-Preserving Decomposition:** Ensuring that all functional dependencies are preserved in the decomposed relations.

#### 3. **Armstrong's Axioms**
- **Reflexivity:** If \( Y \subseteq X \), then \( X \rightarrow Y \).
- **Augmentation:** If \( X \rightarrow Y \), then \( XZ \rightarrow YZ \).
- **Transitivity:** If \( X \rightarrow Y \) and \( Y \rightarrow Z \), then \( X \rightarrow Z \).

#### 4. **Binary Search Trees (BST)**
- **Insertion Order:** The order in which elements are inserted affects the structure of the BST.

#### 5. **SQL Injection**
- **SQL Injection Attacks:** Malicious SQL statements inserted into an entry field to manipulate the database.

#### 6. **Disk Capacity and Performance**
- **Disk Capacity:** Calculated as:
  \[
  \text{Capacity} = \text{Number of Platters} \times \text{Surfaces per Platter} \times \text{Tracks per Surface} \times \text{Sectors per Track} \times \text{Bytes per Sector}
  \]
- **Rotational Latency:** Time taken for the disk to rotate to the desired sector. Calculated as:
  \[
  \text{Rotational Latency} = \frac{1}{2 \times \text{RPM}} \times 60 \times 1000 \text{ ms}
  \]

